import { event } from 'jquery';
import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import '../SignStyle.css';


export class SignUp extends Component {




    state = {
        user : {user_email : ""}
    }




    handleChange = (event) => {
        this.setState({ value: event.target.value });
    }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown">
                    <div id="formContent">
                        <h2 className="active signh2"> Sign Up </h2>

                        <div className="fadeIn first mt-2 mb-2">
                            <i className="fa-solid fa-user fa-6x"></i>
                        </div>

                        <form>
                            <input onChange={() => this.handleChange} type="text" id="email" className="fadeIn second" name="login" value={this.state.user_inf[0].user_email} placeholder="Email adress" />
                            <input type="text" id="Veremail" className="fadeIn second" name="login" placeholder="Verify email" />
                            <input type="password" id="password" className="fadeIn third" name="login" placeholder="password" />
                            <input type="password" id="Verpassword" className="fadeIn third" name="login" placeholder="re-enter password" />
                            <input type="submit" className="fadeIn fourth" value="Sign up" />
                        </form>

                        <div id="formFooter">
                            <Link className="underlineHover" to="/login">Already a member ?</Link>
                        </div>

                    </div>
                </div></div>
        )
    }
}

export default SignUp
